      const response = await fetch('https://react-http-7dce3-default-rtdb.firebaseio.com/meals.json');
      const responseData = await response.json();

    }

    fetchMeals();
  }, []);

  const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));

